    var prepCatCount = 0;
    function prepCat(elem) {
        elem.text = elem.data + ", id:" + elem.attributes.id;
        //if (prepCatCount++ < 3) {
        if (elem.data == 'Решения' || elem.data == 'Каталог товаров на сайте' || elem.data == 'Насосы водяные') {
            elem.state = {opened: true};
        }
        if (elem.children) {
            for (var key in elem.children) {
                prepCat(elem.children[key]);
            }
        }
    }
    
    $('#parse_form').submit(function (e) {
        e.preventDefault();
        $.post('parse.morena.ru.php', $(this).serialize(), function (data) {
            PasingStarted = true;
            alert(data);
            $("#start-panel-wrapper :input").attr("disabled", true);

        }).error(function () {
            alert('Произошла ошибка!');
        });
        return false;
    });
